import React from "react";
import { Box, Grid} from "@material-ui/core";
import Header from "../Header";
import Sidebar from "../SidePanel";

const Layout =(props)=>{
    return (
        <>
            <Header/>
            <Grid container>
                <Grid item xs={4}>
                    <Sidebar/>
                </Grid>
                <Grid item xs={8}>
                    {props.children}
                </Grid>
            </Grid>
        </>
    )
};

export default Layout;
